import React from 'react';

import { Logo, ProgramName, FieldHeader, FieldValue, Container } from './ProgramRow.styles';

const ProgramRow = () => (
    <Container>
        <Logo/>
        <ProgramName>Information Technology</ProgramName>
        <FieldHeader>Degree Type</FieldHeader>
        <FieldValue>Associate's</FieldValue>
        <FieldHeader>Delivery</FieldHeader>
        <FieldValue>100% Fully Online</FieldValue>
        <FieldHeader>Annual Tuition</FieldHeader>
        <FieldValue>$1,375</FieldValue>
    </Container>
);

export default ProgramRow;
